import React, { Component } from 'react'

class Form extends Component {

    constructor(props) {
        super(props)
    
        this.state = {
             TransactionType : 'Credit'
        }
    }
    
    render() {
        return (
            <form>
            <div>
                   <label>Transaction Type</label>
                   <select>
                       <option>Credit</option>
                       <option>Debit</option>
                   </select>
               </div>
               <div>
                   <label>Amount</label>
                   <input type="number"></input>
               </div>
               <div>
                   <label>Description</label>
                   <textarea></textarea>
               </div>
            </form>
        )
    }
}

export default Form
